ools and resources for the job at hand.\n\nLearners who complete this program should be equipped to apply for introductory-level jobs as project managers. No previous experience is necessary.\n\nBy the end of this course, you will be able to: \n - Identify what aspects of a project to track and compare different tracking methods.\n - Discuss how to effectively manage and communicate changes, dependencies, and risks.\n - Explain the key quality management concepts of quality standards, quality planning, quality assurance, and quality control.\n - Describe how to create continuous improvement and process improvement and how to measure customer satisfaction.\n - Explain the purpose of a retrospective and describe how to conduct one. \n - Demonstrate how to prioritize and analyze data and how to communicate a project’s data-informed story. \n - Identify tools that provide effective project team communication and explore best practices for communicating project status updates.\n - Describe the steps of the closing process for stakeholders, the project team, and project managers.","id":"ru_BPAp9EeuMRxJm6C8Z2w","photoUrl":"https:\u002F\u002Fd3njjcbhbojbot.cloudfront.net\u002Fapi\u002Futilities\u002Fv1\u002Fimageproxy\u002Fhttps:\u002F\u002Fcoursera-course-photos.s3.amazonaws.com\u002F76\u002Fe6ea72882d490ca05f53007e811b92\u002F1200x600_certsResize_1.png","slug":"project-execution-google","courseType":"v2.ondemand","name":"Project Execution: Running the Project"}},"courseNavigation.v1":{"64633251~project-execution-google":{"navigationItems":[{"typeName":"weeksNavigationItem","definition":{"weeks":[{"weekStatus":"ONTRACK"},{"weekStatus":"ONTRACK"},{"weekStatus":"ONTRACK"},{"weekStatus":"ONTRACK"},{"weekStatus":"ONTRACK"},{"weekStatus":"ONTRACK"}],"currentWeekNumber":1}},{"typeName":"gradesNavigationItem","definition":{}},{"typeName":"notesNavigationItem","definition":{}},{"typeName":"discussionForumsNavigationItem","definition":{}},{"typeName":"inboxNavigationItem","definiti
